// App.js

import React from 'react';
import { BrowserRouter as Router, Routes } from 'react-router-dom';
import OnboardingPage from './components/OnboardingPage';

function App() {
  return (
    <Router>
      <Routes path="/" exact component={OnboardingPage} />
    </Router>
  );
}

export default App;
